import React from 'react'
import './Popup.css'

function Popup(props) {
	return (props.trigger) ? (
		<div className="popup">
			<div className="popup-inner">
				<div className="widget-name">Profile Widget</div>
				<br></br>
				<div className="wgroup">
				<button className="widget01" onClick={() => props.setTrigger(false)}>widget01</button>
				<button className="widget02" onClick={() => props.setTrigger(false)}>widget02</button>
				<button className="widget03" onClick={() => props.setTrigger(false)}>widget03</button>
				</div>
				<div className="widget-text">Set your Onit!</div>
				{props.children}
			</div>
		</div>
	) : "";
}

export default Popup
